import './redes_sociais.css'

function Redes_Sociais(){
    return(
        <div className='container mt-2'>

           <i class="fa-brands fa-linkedin"></i> 
           <a className="linkedin me-1" href="/">LinkedIn</a>
           <i class=" fa-solid fa-arrow-up-right-from-square me-3"></i>

           <i class="fa-brands fa-github"></i> 
           <a className="git" href="/">Github</a>
           <i class="me-2 fa-solid fa-arrow-up-right-from-square me-3"></i>
        </div>
    );
}

export default Redes_Sociais;
